  false,\n\t\"url\": null,\n\t\"notes\": \"This NOAA Climate Data Record (CDR) of
  Zonal Mean Ozone Binary Database of Profiles (BDBP) dataset is a vertically resolved,
  global, gap-free and zonal mean dataset that was created with a multiple-linear
  regression model. The dataset has a monthly resolution and spans the period 1979
  to 2007. It provides global product in 5 degree zonal bands, and 70 vertical levels
  of the atmosphere. The regression is based on monthly mean ozone concentrations
  that were calculated from several different satellite instruments and global ozone
  soundings. Due to the regression model that was used to create the product, various
  basis function contributions are provided as unique levels or tiers. To understand
  the different contributions of basis functions, the data product is provided in
  five different \"Tiers\". - Tier 0: raw monthly mean data that was used in the regression
  model - Tier 1.1: Anthropogenic influences (as determined by the regression model)
  - Tier 1.2: Natural influences (as determined by the regression model) - Tier 1.3:
  Natural and volcanic influences (as determined by the regression model) - Tier 1.4:
  All influences (as determined by the regression model, CDR variable)\",\n\t\"license_title\":
